import React, { useEffect } from "react";
import "../styles.css";

function HomePage() {
  useEffect(() => {
    const handleScroll = () => {
      const sections = document.querySelectorAll(
        ".features-section, .how-it-works-section, .use-cases-section, .faq-section, .contact-section"
      );
      sections.forEach((section) => {
        const rect = section.getBoundingClientRect();
        if (rect.top < window.innerHeight - 100) {
          section.classList.add("section-visible");
        }
      });
    };

    window.addEventListener("scroll", handleScroll);
    return () => window.removeEventListener("scroll", handleScroll);
  }, []);

  const toggleAnswer = (e) => {
    const answer = e.currentTarget.nextElementSibling;
    const arrow = e.currentTarget.querySelector(".arrow");
    if (answer.style.display === "block") {
      answer.style.display = "none";
      arrow.style.transform = "rotate(0deg)";
    } else {
      answer.style.display = "block";
      arrow.style.transform = "rotate(180deg)";
    }
  };

  return (
    <>
      {/* Updated Hero Section */}
      <header className="hero-section bg-primary text-white" style={{ height: "100vh" }}>
        <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
          <div className="container">
            <a className="navbar-brand fw-bold" href="#">
              HoneSta
            </a>
            <button
              className="navbar-toggler"
              type="button"
              data-bs-toggle="collapse"
              data-bs-target="#navbarNav"
              aria-controls="navbarNav"
              aria-expanded="false"
              aria-label="Toggle navigation"
            >
              <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse" id="navbarNav">
              <ul className="navbar-nav ms-auto">
                <li className="nav-item">
                  <a className="nav-link" href="#features">Features</a>
                </li>
                <li className="nav-item">
                  <a className="nav-link" href="#how-it-works">How It Works</a>
                </li>
                <li className="nav-item">
                  <a className="nav-link" href="#use-cases">Use Cases</a>
                </li>
                <li className="nav-item">
                  <a className="nav-link" href="#faq">FAQs</a>
                </li>
                <li className="nav-item">
                  <a className="nav-link" href="#contact">Contact</a>
                </li>
                <li className="nav-item">
                  <a className="btn btn-outline-light ms-2" href="/login">Login</a>
                </li>
                <li className="nav-item">
                  <a className="btn btn-warning text-dark ms-2" href="/register">Sign Up</a>
                </li>
              </ul>
            </div>
          </div>
        </nav>
        <div className="container text-center h-100 d-flex flex-column justify-content-center align-items-center">
          <h1 className="display-4 fw-bold">Integrity in Every Click, Confidence in Every Step.</h1>
          <p className="lead mt-3">A scalable, privacy-focused proctoring system designed for all institutions.</p>
          <button className="btn btn-light btn-lg mt-4">Get Started</button>
        </div>
      </header>

      {/* Other Sections */}
      <section id="features" className="features-section">
        <h2>Key Features</h2>
        <div className="features-grid">
          <div className="feature-item">
            <img src="behavioral-monitoring.jpg" alt="Behavioral Monitoring" />
            <h3>Behavioral Monitoring</h3>
            <p>Detect suspicious activities through mouse movements, keystrokes, and window shifts.</p>
          </div>
          <div className="feature-item">
            <img src="dynamic-risk-scoring.jpg" alt="Dynamic Risk Scoring" />
            <h3>Dynamic Risk Scoring</h3>
            <p>Real-time analytics calculate and adjust risk scores based on user behavior.</p>
          </div>
          <div className="feature-item">
            <img src="privacy-compliance.jpg" alt="Privacy Compliance" />
            <h3>Privacy-First Design</h3>
            <p>GDPR and FERPA compliant—ensures no video or audio invasion during assessments.</p>
          </div>
          <div className="feature-item">
            <img src="automated-alerts.jpg" alt="Automated Alerts" />
            <h3>Automated Alerts</h3>
            <p>Proactive notifications ensure timely interventions during flagged activities.</p>
          </div>
        </div>
      </section>

      {/* Include rest of the sections as is */}
    </>
  );
}

export default HomePage;
